import { useDispatch } from "react-redux";
import { logout } from "../redux/userRedux";


const Logout=()=>{
 const dispatch = useDispatch();
    const handleClick = (e) => {
        e.preventDefault();
       dispatch(logout());
      };
    return(
<div>
<button onChange={handleClick}>Logout</button>
</div>
    );
};
export default Logout;
